import "./login.css"

export default function Login() {
  return (
    <div className="login">
        <form className="login--form">
            <label>Email</label>
            <input type="text" placeholder="Enter your email..." />
            <label>Password</label>
            <input type="password" placeholder="Enter your password..." />
        </form>
    </div>
  )
}
